\begin{align*}
 l &= 2 l_{sr} + n \times sp + l_\text{rail} (n-1) \\ 
2 l_{sr} &= l - n \times sp - l_\text{rail} (n-1) \\
l_{sr} &= \frac{l - n \times sp - l_\text{rail} (n-1)}{2}
\end{align*}

\begin{align*}
n l_\text{rail} + sp(n-1) &= l - w_{sh} \\
n l_\text{rail} &= l - w_{sh} - sp(n-1) \\
l_\text{rail} &= \frac{l - w_{sh} - sp(n-1)}{n}
\end{align*}
